import React from 'react';

function Profile() {
    return (
        <div className='pf-container'>
            <div className="pf-image">
            <img src={'cover.jpg'} className='pf-cover' alt="cover" />
            <img src={'pf.png'} className='pf-logo' alt="logo" />
            </div>
            <p className='pf-name'>pf-name</p>
            <div className="pf-followers">
                <button className='btn'>followers</button>
                <button className='btn'>following</button>
            </div>
            <div className="frds">
                {/* your frds */}
            </div>
        </div>
    );
}

export default Profile;
